import React, { useRef } from "react";

const HefContainer = () => {
  const listRef = useRef(null);

  function handleClick(event) {
    const list = listRef.current;

    const imgList = list.querySelectorAll("li > img")[event];

    imgList.scrollIntoView({
      behavior: "smooth",
      block: "nearest",
      inline: "center",
    });
  }
  return (
    <>
      <nav style={{ position: "fixed", top: 0, left: 0 }}>
        <button onClick={() => handleClick(0)}>dog</button>
        <button onClick={() => handleClick(1)}>cat</button>
        <button
          onClick={() => {
            handleClick(2);
          }}
        >
          sheep
        </button>
      </nav>
      <div style={{ display: "flex" }}>
        <ul ref={listRef} style={{ display: "flex" }}>
          <li>
            <img
              src="data:image/jpeg;base64,"
              alt=""
            />
          </li>
          <li>
            <img
              src="data:image/jpeg;base64,"
              alt=""
            />
          </li>
          <li>
            <img
              src="data:image/jpeg;base64,"
              alt=""
            />
          </li>
        </ul>
      </div>
    </>
  );
};

export default HefContainer;
